import React, {Component} from 'react'
import {gql} from 'apollo-boost'
import {graphql} from 'react-apollo'

const getBrandsQuery = gql`
{
	brands {
		name
		country
}
}`


class AddCar extends Component {

	render() {
		return (
		<form id="add-car">
                <div className="field">
                    <label>Car name:</label>
                    <input type="text" />
                </div>
                <div className="field">
                    <label>Year:</label>
                    <input type="text" />
                </div>
                <div className="field">
                    <label>Brand:</label>
                    <select>
                        <option>Select brand</option>
                        { this.displayBrands() }
                    </select>
                </div>
                <button>+</button>

            </form>
		);
	}
}

export default graphql(getBrandsQuery)(AddCar)
